function calculateROC(dataList, currentIndex, period2) {
  if (currentIndex < period2) {
    return null;
  }
  const currentPrice = dataList[currentIndex].close;
  const pastPrice = dataList[currentIndex - period2].close;
  if (pastPrice === 0) {
    return null;
  }
  return (currentPrice - pastPrice) / pastPrice * 100;
}
