function calculatePSY(dataList, currentIndex, period2) {
  if (currentIndex < period2) {
    return null;
  }
  let risingCount = 0;
  for (let i = currentIndex - period2 + 1; i <= currentIndex; i++) {
    if (i > 0 && dataList[i].close > dataList[i - 1].close) {
      risingCount++;
    }
  }
  return risingCount / period2 * 100;
}
